const CapitalView = ({ capital }) => (
  <div className="capitalActual">
    <h2 className="text-2xl font-bold text-center">Capital Actual</h2>
    {capital ? (
      <p className="text-xl text-green-600 font-semibold">${capital.capital}</p>
    ) : (
      <p className="text-gray-500">Cargando...</p>
    )}
  </div>
);

export default CapitalView;
